# Churayevo, Mishkinsky District, Republic of Bashkortostan

}}
Churayevo (; , Suray; , ÄŒoraj) is a rural locality (a selo) and the administrative centre of Churayevsky Selsoviet, Mishkinsky District, Bashkortostan, Russia. The population was 984 as of 2010. There are 9 streets.
Geography
Churayevo is located 43&nbsp;km northwest of Mishkino (the district's administrative centre) by road. Oktyabr is the nearest rural locality.
